function Projects() {
    return (
      <div>
      <Navbar />
      <BrowserRouter>
        <Routes>
          <Route path = "/" element = {<Projects />} />
          <Route path = "/projects" element = {<Projects />} />
          <Route path = "/photography" element = {<Photos />} />
          <Route path = "/resume" element = {<Resume />} />
        </Routes>
      </BrowserRouter>
      </div>
    );
  }

export default Projects;
